        {id:1,Name:'Ahmed',Age:'25',Salary:'6000'}
    ]
    return(
        <div>
            <table className="table">
                <Header></Header>
                <Home></Home>
            </table>
            <Footer></Footer>
        </div>
    );
}

export default Componant ;
